import React, { useState, useEffect } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import AdminSidebar from './AdminSidebar';
import ManageInstitutes from './ManageInstitutes';
import ManageUsers from './ManageUsers';
import AnalyticsDashboard from './AnalyticsDashboard';
import { instituteAPI, userAPI, reviewAPI, enquiryAPI } from '../../services/api';
import './AdminPanel.css';

const AdminDashboard = () => {
  const [stats, setStats] = useState({
    totalInstitutes: 0,
    totalUsers: 0,
    totalReviews: 0,
    pendingInstitutes: 0
  });

  useEffect(() => {
    fetchDashboardStats();
  }, []);

  const fetchDashboardStats = async () => {
    try {
      const [institutesRes, usersRes, reviewsRes, pendingRes] = await Promise.all([
        instituteAPI.getAll(),
        userAPI.getAll(),
        reviewAPI.getAll(),
        instituteAPI.getPending()
      ]);

      setStats({
        totalInstitutes: institutesRes.data.length,
        totalUsers: usersRes.data.length,
        totalReviews: reviewsRes.data.length,
        pendingInstitutes: pendingRes.data.length
      });
    } catch (error) {
      console.error('Error fetching stats:', error);
    }
  };

  return (
    <div className="admin-dashboard">
      <AdminSidebar />
      <div className="dashboard-content">
        <Routes>
          <Route path="/" element={<DashboardHome stats={stats} />} />
          <Route path="/institutes" element={<ManageInstitutes />} />
          <Route path="/users" element={<ManageUsers />} />
          <Route path="/analytics" element={<AnalyticsDashboard />} />
          <Route path="*" element={<Navigate to="/admin" replace />} />
        </Routes>
      </div>
    </div>
  );
};

const DashboardHome = ({ stats }) => {
  const [recentActivities, setRecentActivities] = useState([]);

  useEffect(() => {
    // Fetch recent activities
    const fetchRecentActivities = async () => {
      try {
        const [pendingInstitutes, recentReviews] = await Promise.all([
          instituteAPI.getPending(),
          reviewAPI.getAll()
        ]);

        const activities = [
          ...pendingInstitutes.data.slice(0, 3).map(inst => ({
            type: 'institute_registration',
            message: `New institute registration: ${inst.name}`,
            timestamp: inst.createdAt,
            icon: 'üè´'
          })),
          ...recentReviews.data.slice(0, 3).map(review => ({
            type: 'review',
            message: `New review submitted by ${review.user?.name}`,
            timestamp: review.createdAt,
            icon: '‚≠ê'
          }))
        ].sort((a, b) => new Date(b.timestamp) - new Date(a.timestamp)).slice(0, 5);

        setRecentActivities(activities);
      } catch (error) {
        console.error('Error fetching recent activities:', error);
      }
    };

    fetchRecentActivities();
  }, []);

  return (
    <div className="dashboard-home">
      <div className="dashboard-header">
        <h1>Admin Dashboard</h1>
        <p>Manage platform activities and users</p>
      </div>

      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">üè´</div>
          <div className="stat-info">
            <h3>{stats.totalInstitutes}</h3>
            <p>Total Institutes</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üë•</div>
          <div className="stat-info">
            <h3>{stats.totalUsers}</h3>
            <p>Total Users</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">‚≠ê</div>
          <div className="stat-info">
            <h3>{stats.totalReviews}</h3>
            <p>Total Reviews</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">‚è≥</div>
          <div className="stat-info">
            <h3>{stats.pendingInstitutes}</h3>
            <p>Pending Approvals</p>
          </div>
        </div>
      </div>

      <div className="dashboard-content-grid">
        <div className="recent-activities">
          <h2>Recent Activities</h2>
          <div className="activities-list">
            {recentActivities.length === 0 ? (
              <div className="no-activities">
                <p>No recent activities</p>
              </div>
            ) : (
              recentActivities.map((activity, index) => (
                <div key={index} className="activity-item">
                  <div className="activity-icon">{activity.icon}</div>
                  <div className="activity-content">
                    <p>{activity.message}</p>
                    <span>
                      {new Date(activity.timestamp).toLocaleDateString()} at{' '}
                      {new Date(activity.timestamp).toLocaleTimeString()}
                    </span>
                  </div>
                </div>
              ))
            )}
          </div>
        </div>

        <div className="quick-actions">
          <h2>Quick Actions</h2>
          <div className="actions-grid">
            <div 
              className="action-card"
              onClick={() => window.location.href = '/admin/institutes'}
            >
              <div className="action-icon">üè´</div>
              <div className="action-content">
                <h3>Manage Institutes</h3>
                <p>Approve or reject institute registrations</p>
                {stats.pendingInstitutes > 0 && (
                  <span className="pending-badge">{stats.pendingInstitutes} pending</span>
                )}
              </div>
            </div>

            <div 
              className="action-card"
              onClick={() => window.location.href = '/admin/users'}
            >
              <div className="action-icon">üë•</div>
              <div className="action-content">
                <h3>Manage Users</h3>
                <p>Activate or deactivate user accounts</p>
              </div>
            </div>

            <div 
              className="action-card"
              onClick={() => window.location.href = '/admin/analytics'}
            >
              <div className="action-icon">üìä</div>
              <div className="action-content">
                <h3>View Analytics</h3>
                <p>Platform statistics and insights</p>
              </div>
            </div>

            <div className="action-card">
              <div className="action-icon">‚öôÔ∏è</div>
              <div className="action-content">
                <h3>Settings</h3>
                <p>Platform configuration</p>
              </div>
            </div>
          </div>
        </div>
      </div>

      <div className="platform-overview">
        <h2>Platform Overview</h2>
        <div className="overview-cards">
          <div className="overview-card">
            <h3>Institute Categories</h3>
            <div className="category-list">
              <div className="category-item">
                <span className="category-name">Schools</span>
                <span className="category-count">45</span>
              </div>
              <div className="category-item">
                <span className="category-name">Colleges</span>
                <span className="category-count">32</span>
              </div>
              <div className="category-item">
                <span className="category-name">Universities</span>
                <span className="category-count">18</span>
              </div>
              <div className="category-item">
                <span className="category-name">Coaching Centers</span>
                <span className="category-count">27</span>
              </div>
            </div>
          </div>

          <div className="overview-card">
            <h3>Recent Growth</h3>
            <div className="growth-stats">
              <div className="growth-item">
                <span className="growth-label">New Users (7 days)</span>
                <span className="growth-value positive">+24</span>
              </div>
              <div className="growth-item">
                <span className="growth-label">New Institutes (7 days)</span>
                <span className="growth-value positive">+8</span>
              </div>
              <div className="growth-item">
                <span className="growth-label">New Reviews (7 days)</span>
                <span className="growth-value positive">+56</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
